import { useState } from "react";
import UploadFile from "./UploadFile";

const Home = () => {
  const [lyrics, setLyrics] = useState("");
  return (
    <div style={heading}>
      <h1 style={heading}>Music To Image</h1>
      <UploadFile changeLyrics={setLyrics} />
      <h3>{`Lyrics:`}</h3>
      <p>{lyrics}</p>
    </div>
  );
};

const heading = {
  textAlign: "center",
};

export default Home;
